import React from "react";
import { Link, NavLink } from "react-router-dom";

function Header() {
  return (
    <nav className="nav">
      <Link>Logo</Link>
      <NavLink>home</NavLink>
      <NavLink>shop</NavLink>
      <NavLink>deals </NavLink>
    </nav>
  );
}

export default Header;
